expression:
// conventions:
// $xyz: attribute (received as string)
// _xyz: local variable

var _sidc = $feature.sidc;
var _context = $feature.context;
var _identity = $feature.identity;
var _symbolset = $feature.symbolset;
var _status = $feature.status;
var _indicator = $feature.indicator;
var _echelon = $feature.echelon;
var _symbolentity = $feature.symbolentity;
var _modifier1 = $feature.modifier1;
var _modifier2 = $feature.modifier2;
var _specialentitysubtype = $feature.specialentitysubtype;

var _sidc_len = count(_sidc);
if (_sidc_len == 8 || _sidc_len == 10 || _sidc_len == 20) { // extract and replace attribute values from the sidc
  _context = mid(_sidc, 2, 1);
  _identity = mid(_sidc, 3, 1);
  _symbolset = mid(_sidc, 4, 2);
  _status = mid(_sidc, 6, 1);
  _indicator = mid(_sidc, 7, 1);

  if (_sidc_len > 8) {
    _echelon = mid(_sidc, 8, 2);
  } else {
    _echelon = '00';
  }
  if (_sidc_len > 10) {
    _symbolentity = mid(_sidc, 10, 6);
    _modifier1 = mid(_sidc, 16, 2);
    _modifier2 = mid(_sidc, 18, 2);
    if (_symbolset == '10') {
      var entitysubtype = mid(_sidc, 14, 2);
      if (indexof(['95', '96', '97', '98'], entitysubtype) != -1) {
        _specialentitysubtype = entitysubtype;
        _symbolentity = mid(_symbolentity, 0, 4) + '00';
      } else {
        _specialentitysubtype = '';
      }
    }
  } else {
    _symbolentity = '000000';
    _modifier1 = '00';
    _modifier2 = '00';
  }
} else { // use individual attributes
  // symbolset on 2 digits
  if (isempty(_symbolset)) {
    _symbolset = '10';
  } else if (count(_symbolset) == 1) {
    _symbolset = concatenate(['0', _symbolset]);
  }

  // status/operationalcondition
  if (isempty(_status)) {
    _status = $feature.operationalcondition;
  }

  // echelon/mobility/array
  if (isempty(_echelon)) {
    if (isempty($feature.mobility)) {
      _echelon = $feature.array;
    } else {
      _echelon = $feature.mobility;
    }
  }

  // normalize symbolentity on 6 digits
  var _len = count(_symbolentity);
  if (_len < 6) {
    _symbolentity = concatenate([_symbolentity, left('000000', 6 - _len)]);
  } else if (_len > 6) {
    _symbolentity = left(_symbolentity, 6);
  }

  // figure out the special entity subtype case
  if (_symbolset == '10') {
    if (isempty(_specialentitysubtype))
      _specialentitysubtype = mid(_symbolentity, 4, 2);
    if (indexof(['95', '96', '97', '98'], _specialentitysubtype) != -1) {
      _symbolentity = mid(_symbolentity, 0, 4) + '00';
    } else {
      _specialentitysubtype = '';
    }
  }

  // normalize modifiers 1 & 2 on 2 digits
  if (count(_modifier1) == 1) {
    _modifier1 = concatenate(['0', _modifier1]);
  }
  if (count(_modifier2) == 1) {
    _modifier2 = concatenate(['0', _modifier2]);
  }
}

// configuration
var _show_frame = $config.frame != 'OFF' && (_symbolset != '30' || _symbolentity != '150000');
var _show_icon = $config.icon != 'OFF';
var _show_fill = $config.fill != 'OFF' && !(_symbolset == '36' && $config.sea_mine != 'ALTERNATE');
var _show_modifiers = $config.modifiers != 'OFF';
var _show_amplifiers = $config.amplifiers != 'OFF';
var _show_text = $config.text != 'OFF';
var _use_conditionalt = $config.condition != 'PRIMARY';
var _use_sea_mine_medal = $config.sea_mine != 'ALTERNATE';

var _affiliation = decode(_identity, '2', '3', '3', '3', '4', '4', '5', '6', '6', '6', '1');
_status = iif(indexof(['1', '2', '3', '4', '5', '6'], _status) != -1, _status, '0');

// validity of critical attributes
var _invalid_symbolset = indexof(['00', '01', '02', '05', '06', '10', '11', '15', '20', '25', '30', '35', '36', '40', '45', '46', '47', '50', '51', '52', '53', '54', '60'], _symbolset) == -1;
var _invalid_identity = indexof(['0', '1', '2', '3', '4', '5', '6'], _identity) == -1;
var _valid_echelon = indexof(['11', '12', '13', '14', '15', '16', '17', '18', '21', '22', '23', '24', '25', '26'], _echelon) != -1;
var _valid_mobility = indexof(['31', '32', '33', '34', '35', '36', '37', '41', '42', '51', '52'], _echelon) != -1;
var _valid_array = indexof(['61', '62'], _echelon) != -1;
var _valid_symbol_entity = _symbolentity != '000000';
var _invalid_key = 'invalid';

// fix for feature templates
if (_invalid_identity) {
  _identity = '1';
  _invalid_identity = false;
}

// a function to get the frame width (based on the spec dimensions 1.2L, 1.44L, etc. expressed as a percentage)
var _frame_width;
var _symbolset_frame;
function frameWidth() {
  if (isempty(_frame_width)) {
    _frame_width = when(
        !_show_frame, '100',
        _affiliation == '1', iif(indexof(['01', '05', '35'], _symbolset_frame) != -1, '150', '144'),
        _affiliation == '3' || (_affiliation == '6' && _context == '1'), decode(_symbolset_frame, '00', '120', '10', '150', '15', '120', '20', '150', '30', '120', '40', '150', '110'),
        _affiliation == '6', iif(indexof(['01', '05', '35'], _symbolset_frame) != -1, '110', '144'),
        '110' // neutral
      );
  }
  return _frame_width;
}

// calculating the semi-colon delimited keys now
var keys;

// invalid symbol set
if (_invalid_symbolset) {
  keys = _invalid_key;
}

// metoc symbol
else if (indexof(['45', '46', '47'], _symbolset) != -1) {
  // symbol
  keys = concatenate([_symbolset, _symbolentity]);
  // labels
  if (_show_text) {
    keys += ';';
    keys += concatenate([_symbolset, _symbolentity, '_labels']);
  }
}

// from now on, we need a valid identity
else if (_invalid_identity) {
  keys = _invalid_key;
}

// control measure symbol
else if (_symbolset == '25') {
  // symbol
  keys = concatenate(['25', _symbolentity, iif(_status == '1', '_', '')]);
  // echelon
  if (_show_amplifiers) {
    if (_valid_echelon) {
      if (indexof(['110100', '290600'], _symbolentity) != -1) { // only line symbol entity marked with B in the spec
        keys += ';ECH_' + _echelon + '_L';
        // those symbols support a cut effect that we can override to adjust the gap for the echelon
        var middle_gap = decode(_echelon, '22', 24, '23', 32, '24', 36, '25', 40, 20);
        keys += ';po:echelon_cut|MiddleCut|' + middle_gap;
      } else if (indexof(['151200', '151201', '151202', '151203'], _symbolentity) != -1) { // only area symbol entity marked with B in the spec
        keys += ';ECH_' + _echelon + '_A';
        // those symbols support a cut effect that we can override to adjust the gap for the echelon
        var gap = decode(_echelon, '22', 12, '23', 16, '24', 18, '25', 20, 10);
        keys += ';po:echelon_cut|BeginCut|' + gap;
        keys += ';po:echelon_cut|EndCut|' + gap;
      }
    }
    //direction of movement
    if (!isempty($feature.direction)) {
      if (indexof(['281300', '281301', '281400', '281401', '281500', '281600', '281700', '281701'], _symbolentity) != -1) {
        keys += ';DOM_Land';
        // Rotation override
        keys += ';po:DOM_arrow|Rotation|';
        keys += $feature.direction;
        if (_show_text) {
          // OffsetY override
          keys += ';po:DOM_bar|OffsetY|-10';
        }
      }
    }
  }
  // color override
  keys += ';po:cm_color|Color|';
  keys += decode(_affiliation, '3', '#000000', '4', '#00FF00', '6', '#FF0000', '#FFFF00');
  // labels
  if (_show_text) {
    keys += ';';
    keys += concatenate(['25', _symbolentity, '_labels']);
  }
}

// frame symbol
else {
  keys = '';

  // map symbolset for frame icons
  _symbolset_frame = decode(_symbolset, '01', '01', '02', '01', '05', '05', '06', '05', '10', '10', '11', '10', '15', '30', '20', '20', '30', '30', '35', '35', '36', '35', '40', '40', '50', '05', '51', '01', '52', '30', '53', '30', '54', '35', '60', '30', '00');

  // frame fill color
  var _fill_color;
  if ($feature.civilian == '1' && _affiliation != '6')
    _fill_color = decode($config.colors, 'DARK', '#500050', 'MEDIUM', '#800080', '#FFA1FF'); // civilian
  else
    _fill_color = decode(_affiliation,
        '3', decode($config.colors, 'DARK', '#006B8C', 'MEDIUM', '#00A8DC', '#80E0FF'), // friendly
        '4', decode($config.colors, 'DARK', '#00A000', 'MEDIUM', '#00E200', '#AAFFAA'), // neutral
        '6', decode($config.colors, 'DARK', '#C80000', 'MEDIUM', '#FF3031', '#FF8080'), // hostile
        decode($config.colors, 'DARK', '#E1DC00', 'MEDIUM', '#FFFF00', '#FFFF80')); // unknown

  // frame
  if (_show_frame) {
    // frame icon
    var _context_frame = decode(_context, '1', '1', '2', '2', '0');
    keys = concatenate([_context_frame, '_', _identity, _symbolset_frame, iif(_status == '1' && indexof(['1', '3', '4', '6'], _identity) != -1, '_1', '_0')]);
    // fill color override
    keys += ';po:frame_fill|Color|';
    if (_show_fill)
      keys += _fill_color;
    else
      keys += 'RGBA(0,0,0,0)';
    // outline color override for unfilled frames
    if (!_show_fill) {
      keys += ';po:frame_outline|Color|';
      if ($feature.civilian == '1' && _affiliation != '6')
        keys += '#FF00FF'; // civilian magenta
      else
        keys += decode(_affiliation,
          '3', '#00FFFF', // friendly cyan
          '4', '#00FF00', // neutral green
          '6', '#FF0000', // hostile red
          '#FFFF00'); // unknown yellow
    }
  }

  // icon
  if (_show_icon && _symbolset != '00') {
    if (_valid_symbol_entity) {
      // identity suffix for icons
      var _affiliation_icon = iif(
          _context == '1',
          decode(_identity, '2', '_1', '3', '_1', '4', '_2', '5', '_1', '6', '_1', '_0'),
          decode(_identity, '2', '_1', '3', '_1', '4', '_2', '5', '_3', '6', '_3', '_0'));

      //special case for sea mine medal/alternate
      var _alt_sea_mine_suffix;
      if (_symbolset == '36' && !_use_sea_mine_medal)
        _alt_sea_mine_suffix = '_alt';
      keys += ';';
      keys += concatenate([
          concatenate([_symbolset, _symbolentity, _alt_sea_mine_suffix]), // non touching frames
          concatenate([_symbolset, _symbolentity, _affiliation_icon]) // touching frames - we have to provide both since we can't query the existence of the icon
        ], '|');
      if (!_show_frame && _symbolset != '36') {
        keys += ';po:icon_element|Color|';
        keys += _fill_color;
      }
    } else {
      keys += ';35140000'; // question mark icon for invalid symbol entity
    }
  } else {
    if (!_show_frame) {
      keys += ';icon_off'; // our default circle
      if (_show_fill) {
        keys += ';po:icon_element|Color|';
        keys += _fill_color;
      }
    }
  }

  // modifiers
  if (_show_modifiers) {
    // modifier1
    if (_modifier1 != '00' && count(_modifier1) == 2) {
      keys += ';';
      keys += concatenate([_symbolset, _modifier1, '1']);
    }
    // modifier2
    if (_modifier2 != '00' && count(_modifier2) == 2) {
      keys += ';';
      keys += concatenate([_symbolset, _modifier2, '2']);
    }
    // land unit special
    if (_symbolset == '10' && _valid_symbol_entity && indexof(['95', '96', '97', '98'], _specialentitysubtype) != -1) {
      keys += ';';
      keys += concatenate(['10XXXX', _specialentitysubtype, _affiliation_icon]);
    }
  }

  // amplifiers
  if (_show_amplifiers) {
    // an offset to place elements on top of the frame or icon
    var offsetTop;
    if (_show_frame) {
      offsetTop = when(
          _affiliation == '3' || (_affiliation == '6' && _context == '1'),
          decode(_symbolset_frame, '01', 15, '05', 15, '10', 10, '20', 10, '35', 10, '40', 10, 12),
          _affiliation == '1' || _affiliation == '6',
          decode(_symbolset_frame, '01', 16, '05', 16, '35', 10, 14.5),
          decode(_symbolset_frame, '01', 13, '05', 13, 11));
    } else if (_show_icon) {
      offsetTop = 10; // octagon
    } else {
      offsetTop = 5; // circle
    }
    var offsetBottom;
    if (_show_frame) {
      offsetBottom = when(
          _affiliation == '3' || (_affiliation == '6' && _context == '1'),
          decode(_symbolset_frame, '01', 10, '05', 10, '10', 10, '20', 10, '35', 16, '40', 10, 12),
          _affiliation == '1' || _affiliation == '6',
          decode(_symbolset_frame, '01', 10, '05', 10, '35', 16, 14.5),
          decode(_symbolset_frame, '01', 10, '05', 10, '35', 14, 11));
    } else if (_show_icon) {
      offsetBottom = 10; // octagon
    } else {
      offsetBottom = 5; // circle
    }
    // echelon, mobility, array
    if (_valid_echelon) {
      // echelon
      keys += ';ECH_' + _echelon + '_P';
      // OffsetY override
      keys += ';po:echelon|OffsetY|';
      keys += offsetTop + 2.5;
    } else if (_valid_array || _valid_mobility) {
      // mobility or array
      keys += ';MOB_' + _echelon;
      // OffsetY override
      keys += ';po:mobility|OffsetY|';
      keys += -offsetBottom - 3;
      // increment offset in case we show an operational condition
      offsetBottom += 6;
    }
    // HQ
    if (indexof(['2', '3', '6', '7'], _indicator) != -1) {
      if (!_show_frame) {
        if (!_show_icon) {
          keys += ';HQ_DOT';
        } else {
          keys += ';HQ_ICON';
        }
      } else {
        var _symbolset_HQ = decode(_symbolset_frame, '00', '30', '01', '01', '05', '01', '30', '30', '35', '35', '10');
        var _affiliation_HQ = iif(_affiliation == '6' && _context == '1', '3', _affiliation);
        keys += ';HQ_' + _affiliation_HQ + '_' + _symbolset_HQ;
      }
    }
    // TF
    if (indexof(['4', '5', '6', '7'], _indicator) != -1) {
      // get the TF variation that matches the echelon width
      keys += ';TF_';
      if (indexof(['22', '23', '24', '25'], _echelon) != -1) {
        keys += _echelon;
      }
      // OffsetY override
      keys += ';po:TF|OffsetY|';
      keys += offsetTop; // TF symbols are anchored at base
    }
    // FD
    if (indexof(['1', '3', '5', '7'], _indicator) != -1) {
      keys += ';FD_' + frameWidth();
      // OffsetY override
      keys += ';po:FD|OffsetY|';
      keys += offsetTop; // FD symbols are anchored at base
    }
    // operational condition
    if (_use_conditionalt) {
      //alternate operational condition bar
      if (indexof(['2', '3', '4', '5'], _status) != -1) {
        keys += ';OC_alt_' + _status + '_' + frameWidth();
        // OffsetY override
        keys += ';po:op_cond|OffsetY|';
        keys += -offsetBottom - 3; // OC symbols are centred
        // increment offset in case we show direction of movement
        offsetBottom += 6;
      }
    } else {
      //primary operational condition symbol
      if (indexof(['3', '4'], _status) != -1) {
        keys += ';OC_' + _status;
      }
    }
    //direction of movement
    if (!isempty($feature.direction)) {
      if (indexof(['10', '11', '15'], _symbolset) != -1) {
        keys += ';DOM_Land';
        // OffsetY override
        keys += ';po:DOM_bar|OffsetY|';
        keys += -offsetBottom;
      } else if (_symbolset != '20') {
        keys += ';DOM'
      }
      // Rotation override
      if (_symbolset != '20') {
        keys += ';po:DOM_arrow|Rotation|';
        keys += $feature.direction;
      }
    }
  }

  // labels
  if (_show_text) {
    // mapped symbolset for labels
    var _symbolset_labels = decode(_symbolset, '01', '01', '02', '01', '05', '05', '06', '05', '10', '10', '11', '10', '15', '10', '20', '10', '30', '30', '35', '35', '36', '35', '40', '40', '50', '05', '51', '01', '52', '10', '53', '30', '54', '35', '60', '30', '00');
    keys += ';' + _symbolset_labels + '_labels';
  }
}

return keys;
